import {
  FiUserPlus,
  FiEdit2,
  FiTrash2,
  FiShoppingCart,
  FiHeart,
} from "react-icons/fi";
import { useState } from "react";
import { Link } from "react-router-dom";

export default function UserList() {
  // Mock data - replace with real API calls
  const [users, setUsers] = useState([
    {
      id: "usr_01",
      name: "Emma Johnson",
      email: "emma@example.com",
      cartItems: 3,
      wishlistItems: 5,
      orders: 2,
    },
    {
      id: "usr_02",
      name: "James Smith",
      email: "james@example.com",
      cartItems: 1,
      wishlistItems: 2,
      orders: 5,
    },
  ]);

  const [isAddUserOpen, setIsAddUserOpen] = useState(false);

  // Handler functions
  const handleAddUser = (newUser) => {
    setUsers([...users, newUser]);
    setIsAddUserOpen(false);
  };

  const handleDelete = (userId) => {
    setUsers(users.filter((user) => user.id !== userId));
  };

  return (
    <div className="p-6 bg-rose-25 min-h-screen ml-64">
      {/* Header Section */}
      <div className="flex justify-between items-center mb-8">
        <div>
          <h1 className="text-2xl font-serif font-bold text-rose-800">
            User Management
          </h1>
          <p className="text-amber-900/80">Manage your store's customers</p>
        </div>
        <button
          onClick={() => setIsAddUserOpen(true)}
          className="flex items-center gap-2 bg-rose-700 hover:bg-rose-800 text-white px-4 py-2 rounded-lg transition-colors"
        >
          <FiUserPlus /> Add New User
        </button>
      </div>

      {/* Users Table */}
      <div className="bg-white rounded-xl shadow-sm border border-rose-100 overflow-hidden">
        <table className="min-w-full divide-y divide-rose-100">
          <thead className="bg-rose-50">
            <tr>
              <th className="px-6 py-3 text-left text-xs font-medium text-amber-900 uppercase tracking-wider">
                ID
              </th>
              <th className="px-6 py-3 text-left text-xs font-medium text-amber-900 uppercase tracking-wider">
                Name
              </th>
              <th className="px-6 py-3 text-left text-xs font-medium text-amber-900 uppercase tracking-wider">
                Email
              </th>
              <th className="px-6 py-3 text-left text-xs font-medium text-amber-900 uppercase tracking-wider">
                Cart
              </th>
              <th className="px-6 py-3 text-left text-xs font-medium text-amber-900 uppercase tracking-wider">
                Wishlist
              </th>
              <th className="px-6 py-3 text-left text-xs font-medium text-amber-900 uppercase tracking-wider">
                Orders
              </th>
              <th className="px-6 py-3 text-right text-xs font-medium text-amber-900 uppercase tracking-wider">
                Actions
              </th>
            </tr>
          </thead>
          <tbody className="bg-white divide-y divide-rose-50">
            {users.map((user) => (
              <tr key={user.id} className="hover:bg-rose-50/50">
                <td className="px-6 py-4 whitespace-nowrap text-sm font-medium text-rose-800">
                  {user.id}
                </td>
                <td className="px-6 py-4 whitespace-nowrap text-sm text-amber-900">
                  {user.name}
                </td>
                <td className="px-6 py-4 whitespace-nowrap text-sm text-amber-900">
                  {user.email}
                </td>
                <td className="px-6 py-4 whitespace-nowrap">
                  <button className="flex items-center gap-1 text-rose-700 hover:text-rose-900">
                    <FiShoppingCart /> {user.cartItems}
                  </button>
                </td>
                <td className="px-6 py-4 whitespace-nowrap">
                  <button className="flex items-center gap-1 text-rose-700 hover:text-rose-900">
                    <FiHeart /> {user.wishlistItems}
                  </button>
                </td>
                <td className="px-6 py-4 whitespace-nowrap text-sm text-amber-900">
                  {user.orders}
                </td>
                <td className="px-6 py-4 whitespace-nowrap text-right text-sm font-medium space-x-2">
                  <button className="text-amber-600 hover:text-amber-800">
                    <FiEdit2 />
                  </button>
                  <button
                    onClick={() => handleDelete(user.id)}
                    className="text-rose-600 hover:text-rose-800"
                  >
                    <FiTrash2 />
                  </button>
                </td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>

      {/* Add User Modal */}
      <AddUserModal
        isOpen={isAddUserOpen}
        onClose={() => setIsAddUserOpen(false)}
        onAddUser={handleAddUser}
      />
    </div>
  );
}
